import { createRouter, createWebHistory } from 'vue-router'
// import HomeView from '../views/HomeView.vue'
import TableView from '@/views/TableView.vue'

const routes = [
  {
    path: '/table',
    name: 'TableView',
    component: TableView
  },
  {
    path: '/list-user',
    name: 'ListUser',
    component: () => import('../views/ListUser.vue')
  },
  {
    path: '/user-profile',
    name: 'UserProfile',
    component: () => import('../views/UserProfile.vue')
  },
  {
    path: '/Typografi',
    name: 'TypoView',
    component: () => import('../views/TypoView.vue')
  },
  {
    path: '/dashboard',
    name: 'DasboardView',
    component: () => import('../views/DashboardView.vue')
  },
  {
    path: '/list-penyewa',
    name: 'ListPenyewa',
    component: () => import('../views/ListPenyewa.vue')
  },
  {
    path: '/list-pemilik',
    name: 'ListPemilik',
    component: () => import('../views/ListPemilik.vue')
  },
  {
    path: '/status-penyewa',
    name: 'StatusPenyewa',
    component: () => import('../views/StatusPenyewa.vue')
  },
  {
    path: '/tambah-user',
    name: 'TambahUser',
    component: () => import('../views/TambahUser.vue')
  },
  {
    path: '/tambah-penyewa',
    name: 'TambahPenyewa',
    component: () => import('../views/TambahPenyewa.vue')
  },
  {
    path: '/tambah-pemilik',
    name: 'TambahPemilik',
    component: () => import('../views/TambahPemilik.vue')
  },
  {
    path: '/edit-user/:id',
    name: 'EditUser',
    component: () => import('../views/EditUser.vue'),
    props: true
  },


]

const router = createRouter({
  history: createWebHistory(process.env.BASE_URL),
  routes
})

export default router
